import React, { useState } from 'react';
import './App.css'; // Import CSS file for styling

function App() {
  // State for selected donation and custom donation input
  const [selectedDonation, setSelectedDonation] = useState("");
  const [customDonation, setCustomDonation] = useState("");

  // Handle custom donation input
  const handleCustomDonationChange = (e) => {
    setCustomDonation(e.target.value);
    if (e.target.value === "") {
      setSelectedDonation("0"); // Default to 0 if no input in custom donation
    } else {
      setSelectedDonation(e.target.value); // Set custom input as the selected donation
    }
  };

  // Handle selection of predefined donation options
  const handleDonationSelect = (amount) => {
    setSelectedDonation(amount);
    setCustomDonation(""); // Clear custom donation input when a predefined amount is selected
  };

  return (
    <div className="container">
      <h1>Help CFE Raise $125K to Create Opportunity & Activate Potential in Underrepresented Communities!</h1>

      {/* Progress bar */}
      <div className="progress-bar">
        <div className="progress" style={{ width: '50%' }}></div>
      </div>

      {/* Centered donation text */}
      <div className="donation-summary">
        <p><strong>$62,552</strong> of $125,000 raised by 159 donors</p>
        {/* Centered image underneath */}
        <img
          src="./img/donate.png"
          alt="Main Image" 
          className="main-image" 
        />
      </div>

      {/* Donation options */}
      <div className="donation-options">
        <div 
          className={`donation-card ${selectedDonation === "250" ? 'selected' : ''}`} 
          onClick={() => handleDonationSelect("250")}
        >
          <h2>$250 Donation</h2>
          <p>With your donation of $250 or more, we will gift you a Charter Membership to our thriving BIPOC-centered community.</p>
        </div>
        <div 
          className={`donation-card ${selectedDonation === "50" ? 'selected' : ''}`} 
          onClick={() => handleDonationSelect("50")}
        >
          <h2>$50 Donation</h2>
          <p>With your donation of $50 or more, we will gift you the eBook, <strong>30 Days to Greater Self Love</strong>, to help celebrate YOU.</p>
        </div>
        <div 
          className={`donation-card ${customDonation !== "" || selectedDonation === "0" ? 'selected' : ''}`}
          onClick={() => handleDonationSelect("0")}
        >
          <h2>Custom Donation</h2>
          <p>Any amount you can give helps us reach our goals. It's all about gratitude!</p>
          <input 
            type="text" 
            placeholder="$ USD" 
            value={customDonation}
            onChange={handleCustomDonationChange}
            onClick={() => handleDonationSelect("0")} // Make the custom option selectable when input is clicked
          />
        </div>
      </div>

      {/* Display selected donation amount */}
      {selectedDonation && (
        <div className="selected-amount">
          {customDonation !== "" || selectedDonation === "0"
            ? <p>You have selected a custom donation of <strong>${customDonation || "0"}</strong></p>
            : <p>You have selected a donation of <strong>${selectedDonation}</strong></p>
          }
        </div>
      )}

      {/* Image grid */}
      <div className="image-grid">
        {/* Replace these placeholder images with actual URLs or import them as needed */}
        <img src="https://via.placeholder.com/100" alt="Person 1" />
        <img src="https://via.placeholder.com/100" alt="Person 2" />
        <img src="https://via.placeholder.com/100" alt="Person 3" />
        <img src="https://via.placeholder.com/100" alt="Person 4" />
        <img src="https://via.placeholder.com/100" alt="Person 5" />
        {/* Add more images as needed */}
      </div>

      {/* Footer */}
      <footer>
        <p>&copy; 2024 Coaching for Everyone</p>
      </footer>
    </div>
  );
}

export default App;
